import './Navbar.css';
import './logo_image.jpg';
import LogoIamgeTransparent from './logo_image_transparent.jpg';
import './linkedin.svg';
import './linkedin(1).svg';
import './github.svg';
import './github(1).svg';
import './twitter.svg';
import './twitter(1).svg';


const Navbar = () => {
  return (
    <section className='NavigationBar'>
        {/** 
        <h2 style={{color: "green", margin: "0px", backgroundColor: "white", padding:"5px", fontWeight:"bold", fontSize: "24px"}}>*** Starting By The Name Of Almighty ALLAH ***</h2>
        */}

        <a href='#Intro' onClick={() => window.location.reload('#Intro')}>
        <img src='./logo_image'/>
        </a>

        <ul>
          <li><a href='#Intro'>Home</a></li>
          <li><a href='#About'>About</a></li>
          <li><a href='#Projects'>Works</a></li>
          <li><a href='#Skill'>Skills</a></li>
          <li><a href='#Experience'>Experiences</a></li>
          <li><a href='#Education'>Educations</a></li>
          <li><a href='#Certifications'>Certifications</a></li>
          <li><a href='#Course'>Courses</a></li>
          <li><a href='#Language'>Languages</a></li>
          <li><a href='#Test'>Tests</a></li>
          <li><a href='#ContactMe'>Contact</a></li>

          <li><a href='#HireMe' className='Active'>Hire Me</a></li>
        </ul>

        <a href='https://www.linkedin.com/in/md-jahid-hasan-584712243/' target='_blank'>
        <img src='./linkedin.svg'/>
        </a>
        <a href='https://github.com/hmjahid' target='_blank'>
        <img src='./github.svg'/>
        </a>
        <a href='https://twitter.com/mdjahidhasan919' target='_blank'>
          <img src='./twitter.svg'/>
        </a>
    </section>
  )
}

export default Navbar;
